import style from "./Search.module.css";

export default function SearchBar(props) {
  return (
    <div className={style.Barra}>
      <input className={style.Busqueda} type="search" />
      <button className={style.Boton}
        onClick={() => {
          props.onSearch();
        }}
      >
        Agregar
      </button>
    </div>
  );
}
